Defendant in custody on WRIT.
On count 1, 2nd degree recklessly endangering safety and count 2, OWI - 5th offense, defendant is sentenced to the Wisconsin State Prison System for a total of three (3) years and six (6) months.  That is one (1) year and six (6) months initial confinement followed by two (2) years extended supervision, on each count, concurrent, but consecutive to the sentences presently being served on Sheboygan County cases.
The Court finds the defendant ineligible for the Challenge Incarceration Program but eligible for the Substance Abuse Program.
Conditions of extended supervision:
1) pay $1,000.00 fine plus costs;
2) AODA assessment and driver safety plan;
3) provide DNA sample and pay the surcharge;
4) maintain absolute sobriety;
5) assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
6) pay supervision fees in an amount to be determined by DOC.
In addition, the Court orders a thirty-six (36) month DL revocation and period of Ignition Interlock.
